import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function Studdent() {
  return (
      <>
      <Container>
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1 },
      }}
      noValidate
      autoComplete="off"
    >
    
      <TextField id="standard-basic" label="Student Name" variant="outlined" />
      <br></br>
      <TextField id="standard-basic" label="Student Address" variant="outlined" />
    </Box>
    </Container>
    </>
  );
}
